import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';

const index = () => {
    return (
        <div>
            <Container fluid>
                <Row>
                    <Col><h4>yo</h4></Col>
                </Row>
            </Container>
        </div>
    );
}

export default index;
